# Welcome to the Custom NPCs config file. There are a few rules when editing YML files.
# 1. NEVER, EVER use tabs. Always use 2 spaces.
# 2. A '#' means the line is commented out. The server will ignore the line.
# 3. If you delete a portion of the config, you can delete the 'Config.yml' and a new one
#    will be automatically generated on the next server start.

# DO NOT, under ANY circumstances modify the 'CONFIG_VERSION' field. Doing so can cause catastrophic data loss.
CONFIG_VERSION: 6

# InjectionDistance -> How close should a player be to the NPC before the plugin attempts to inject the NPC (Due to minecraft, npcs automatically remove themselves after getting 48 blocks from the player.
InjectionDistance: 48

# InjectionInterval -> How often should the plugin attempt to inject NPCs into players? (in ticks)
InjectionInterval: 10 # .5 seconds

# HologramUpdateInterval -> How often should the plugin update NPC holograms? (in ticks)
HologramUpdateInterval: 200 # 10 seconds

# LookInterval -> How often should the plugin update where the NPCs are looking? (in ticks)
LookInterval: 5 # .25 seconds

# DisplayClickText -> Should the plugin display a hologram above the NPC's head if it is interactable?
DisplayClickText: true

# ClickText -> The hologram displayed above the NPC if it is interactable
# NOTE: This uses MiniMessage format.
ClickText: '<b><yellow>Click</yellow></b>'

# AlertOnUpdate -> Should the plugin alert you when there is an update available?
# NOTE: This only notifies players with the 'customnpcs.alert' permission
AlertOnUpdate: true

# DisableCollisions -> Should NPCs move players while their hitboxes collide?
DisableCollisions: true

# NameReferenceMessages -> Should the plugin send you a message with the NPC's current name whilst attempting to change it?
NameReferenceMessages: true

